import AdminHeader from "./components/AdminHeader";
import "./AdminDashboard.css";

const AdminDashboard = () => {
  return (
    <>
      <AdminHeader />

      <div className="admin-container">
        <h3>Dashboard Overview</h3>

        <div className="stats">
          <div>130 <br /> Users</div>
          <div>67 <br /> Career Options</div>
          <div>45 <br /> Courses</div>
          <div>39 <br /> Colleges</div>
        </div>

        <div className="section">Manage Careers</div>
        <div className="section">Manage Courses</div>
        <div className="section">Manage Colleges/Institutions</div>
        <div className="section">Manage Quiz Questions</div>
        <div className="section">Manage Users</div>
      </div>
    </>
  );
};

export default AdminDashboard;
